// src/components/Navbar.jsx
import React from 'react';
import { Link } from 'react-router-dom';
<link rel="stylesheet" href="../../public/style.css" />

function Navbar() {
  // State to track the visibility of the dropdown
  const [isDropdownVisible, setDropdownVisible] = useState(false);

  // Function to toggle the dropdown visibility
  const toggleDropdown = () => {
    setDropdownVisible(!isDropdownVisible);
  };
  return (
    <header class="header">
    {/* NSS logo */}
      <a class="nss-logo" href="https://nsscrce.org/">
        <img src="/images/nss-logo.svg" />
      </a>
      {/* FRCRCE logo */}
      <a class="father-logo">
        <img src="/images/father-logo.svg" />
      </a>
      <a class="crce-logo" href="http://frcrce.ac.in/">
        <img src="/images/crce-logo.svg" />
      </a>
      {/* Page title */}
      <div class="nss-title">
        <a><h1>NSS CRCE</h1></a>
      </div>

      <ul>
        <li><Link to="/">Home</Link></li>
        <li><Link to="/">Vol.Data</Link></li>
        <li className="dropdown">
          <a href="#" className="dropbtn">Teams</a>
          <div className="dropdown-content">
            <Link to="/team-2023-24">Team 2023-24</Link>
            {/* Add more dropdown links as needed */}
          </div>
        </li>
        <li className="dropdown">
          <a href="#" className="dropbtn">Events</a>
          <div className="dropdown-content">
            <Link to="/page1">Events 2023-24</Link>
            {/* Add more dropdown links as needed */}
          </div>
        </li>
        {/* Add more navigation links */}
      </ul>
    </header>
  );
}

export default Navbar;
